    const [videos, setVideos] = useState([]);
    const {id} = useParams()

    useEffect(() => {
        const getData = async () =>{
            try{
                const data = ApiService.fetching(`search?part=snippet&q=${id}`)
                console.log(data);
                setVideos(data.items)
            }catch (error) {
                console.log(error);
            }
        }
        getData()
    }, [id])
    
